import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './PeopleOnGround.css';  // ðŸ‘ˆ Create this CSS file

export default function PeopleOnGround() {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  const load = () => {
    axios.get('/api/people_on_ground')
      .then(res => { setData(res.data); setError(null); })
      .catch(err => { setError(err.message); });
  };

  useEffect(() => { load(); }, []);

  return (
    <div className="container">
      <h2>People on the Ground</h2>
      <button className="refresh-btn" onClick={load}>Refresh</button>
      {error && <p className="error">Failed to load: {error}</p>}

      <table className="people-table">
        <thead>
          <tr>
            <th>Airport</th>
            <th>Name</th>
            <th>City</th>
            <th>State</th>
            <th>Country</th>
            <th>Departing From</th>
            <th># Pilots</th>
            <th># Passengers</th>
            <th># Total</th>
            <th>Person List</th>
          </tr>
        </thead>
        <tbody>
          {data.map((entry, i) => (
            <tr key={i}>
              <td>{entry.airport}</td>
              <td>{entry.airport_name}</td>
              <td>{entry.city}</td>
              <td>{entry.state || '-'}</td>
              <td>{entry.country}</td>
              <td>{entry.departing_from}</td>
              <td>{entry.num_pilots}</td>
              <td>{entry.num_passengers}</td>
              <td>{entry.joint_pilots_passengers}</td>
              <td>{entry.person_list}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
